import React from 'react'
import { makeStyles } from '@mui/material'

const useStyles = makeStyles({
    page:{
        background: '#1b5e20',
        width: "100%"
    }
})

export default function Layout({ children }){
    const classes = useStyles()

    return(
        <div className={classes.page}>
            {children}
        </div>
    );
}
